    const IncNum = () => {
        let cuTime = date.toLocaleTimeString();
        setTime(cTime);
    };

    return (
        <>
          <h1>{time}</h1>
          <button onClick={IncNum}>Click Me</button> 
        </>

    );
}

export default App;
